import React from 'react'
import Styled from 'styled-components'
function Articles(posts) {
    return (
        <MainContainer>
            welcome to Articles

            {
                posts.posts.map((article,key)=>{
                    console.log(article)
                    return(
                        <div>
                    <h2>{article.title}</h2>
                   <p>{article.article}</p>
                   <span>{article.authername}</span>
                </div>
                    )
                })


            }
        </MainContainer>

    )
}

export default Articles
const MainContainer = Styled.div `
margin:7rem
`
